document.addEventListener("DOMContentLoaded",(function(){let e=document.getElementsByClassName("im-lazy");for(var n=0;n<e.length;n++)e.item(n).onmouseenter=function(){if(this.classList.contains("loaded"))return;this.blockID=this.children[0].getAttribute("data-block");t(this)};const t=e=>{fetch(`${window.location.origin}/wp-json/lazyMenu/UX/block/${e.blockID}`).then((e=>e.json())).then((n=>{e.classList.add("loaded"),e.querySelectorAll(".sub-menu")[0].innerHTML=n.block,spinner=e.getElementsByClassName("loading-spin"),spinner[0].remove()}))}}));